import React from 'react'
import "./OrderFood.css"
import NavbarAddToCart from "../CustomerRestaurant/NavbarAddToCart.jsx"
import {Row,Col} from "react-bootstrap";

function AddtoCartItemOrderFood({cart}) {

  let total=0;
  var val;
  val=parseInt(cart.price.replace('$', ''))

    return (
     <div className="container-fluid">
     <div className="row w-100">
     <Col className="d-flex flex-row justify-content-center mt-3 p-2 rounded">
      {cart.id}
     </Col>
     <Col className="d-flex flex-row justify-content-center mt-3 p-2 rounded">
      {cart.dish_name}
      </Col>
     <Col className="d-flex flex-row justify-content-center mt-3 p-2  rounded">
      {cart.price}
     </Col>
     <Col className="d-flex flex-row justify-content-center mt-3 p-2  rounded">
      {total+=val}
     </Col>
     </div>
     <hr />
     </div>
    );
}

export default AddtoCartItemOrderFood;
